                    <div className="card">

                        <div className="table-responsive mt-4" id="">
                            <table className="table align-items-center table-flush table-hover mt-3 dataTable no-footer" id="users_tbl" role="grid" aria-describedby="users_tbl_info">
                                <thead className="thead-light">
                                    <tr role="row"><th scope="col" className="sorting sorting_desc" tabindex="0" aria-controls="users_tbl" rowspan="1" colspan="1" aria-sort="descending" aria-label="Fullname: activate to sort column ascending" style="width: 437.734px;">Fullname</th><th scope="col" className="sorting" tabindex="0" aria-controls="users_tbl" rowspan="1" colspan="1" aria-label="Email: activate to sort column ascending" style="width: 304.953px;">Email</th><th scope="col" className="sorting" tabindex="0" aria-controls="users_tbl" rowspan="1" colspan="1" aria-label="Role: activate to sort column ascending" style="width: 178.484px;">Role</th><th scope="col" className="sorting" tabindex="0" aria-controls="users_tbl" rowspan="1" colspan="1" aria-label="Branch: activate to sort column ascending" style="width: 273.656px;">Branch</th><th scope="col" className="sorting" tabindex="0" aria-controls="users_tbl" rowspan="1" colspan="1" aria-label="Status: activate to sort column ascending" style="width: 169.344px;">Status</th><th scope="col" className="sorting" tabindex="0" aria-controls="users_tbl" rowspan="1" colspan="1" aria-label="Action: activate to sort column ascending" style="width: 171.828px;">Action</th></tr>
                                </thead>
                                <tbody className="list">

                                </tbody>
                            </table>
                        </div>

                    </div>
                </div>
            </div>
        </div>
    );
}

export default Users;
